import React, { useState } from "react";
import { Link, withRouter } from "react-router-dom";

const Home = (props) => {
	const [openMenu, setOpenMenu] = useState(false);

	const pushToRoute = (route) => {
		props.history.push(route);
		setOpenMenu(false);
	};
	return (
		<div class="home">
			<div>
				<h3>
					<Link onClick={() => pushToRoute("/login")}>Login</Link>
				</h3>
			</div>
			<div>
				<h3>
					<Link onClick={() => pushToRoute("/signup")}>Signup</Link>
				</h3>
			</div>
		</div>
	);
};
export default Home;
